map<int,int>cost;

int n,m,p;

void bfs(int node)
{
    priority_queue<heap>q;
    for (int i = 0; i < N; ++i)
    {
        dist[i] = MOD;
    }
    dist[node] = 0;
    q.push({0LL,node});
    while(!q.empty())
    {
        int w = q.top().first;
        int nod = q.top().second;
        //cerr<<"current node: "<<nod<<"\tweight: "<<w<<'\n';
        q.pop();
        for (auto i : v[nod])
        {
            if (dist[i.first] > dist[nod]+i.second+cost[i.first])
            {
                dist[i.first] = dist[nod]+i.second+cost[i.first];
                q.push({dist[i.first],i.first});
            }
        }
    }
}

